CREATE TABLE Ciudades(
id_ciudad int,
ciudad varchar(40)
CONSTRAINT pk_ciudad PRIMARY KEY (id_ciudad))
 
CREATE TABLE Barrios(
id_barrio int,
barrio varchar(40),
id_ciudad int
CONSTRAINT pk_barrio PRIMARY KEY(id_barrio),
CONSTRAINT fk_barrio_ciudad FOREIGN KEY (id_ciudad)
        	REFERENCES Ciudades(id_ciudad))
 
CREATE TABLE Situaciones_laborales(
id_situacion_laboral int IDENTITY(1,1),
situacion_laboral varchar(40)
CONSTRAINT pk_situacion_laboral PRIMARY KEY (id_situacion_laboral))
 
CREATE TABLE Estados_civiles(
id_estado_civil int IDENTITY(1,1),
estado_civil varchar(40)
CONSTRAINT pk_estado_civil PRIMARY KEY(id_estado_civil))
 
CREATE TABLE Alumnos(
id_alumno int,
nom_alumno varchar(30),
ape_alumno varchar(30),
direccion varchar(50),
altura int,
nro_tel varchar(30),
email varchar(60),
id_barrio int,
id_situacion_laboral int,
id_estado_civil int
CONSTRAINT pk_alumno PRIMARY KEY (id_alumno),
CONSTRAINT fk_alumno_barrio FOREIGN KEY (id_barrio)
        	REFERENCES Barrios(id_barrio),
CONSTRAINT fk_alumno_situacion_laboral FOREIGN KEY (id_situacion_laboral)
        	REFERENCES Situaciones_laborales(id_situacion_laboral),
CONSTRAINT fk_alumno_estado_civil FOREIGN KEY (id_estado_civil)
        	REFERENCES Estados_civiles(id_estado_civil));
 
CREATE TABLE Estados_academicos(
id_estado_academico int IDENTITY(1,1),
estado_academico varchar(40)
CONSTRAINT pk_estado_academico PRIMARY KEY (id_estado_academico))
 
CREATE TABLE Tecnicaturas(
id_tecnicatura int,
nom_tecnicatura varchar(70),
titulo_tecnicatura varchar(70)
CONSTRAINT pk_tecnicatura PRIMARY KEY (id_tecnicatura))
 
CREATE TABLE Materias(
id_materia int,
id_tecnicatura int,
nom_materia varchar(60)
CONSTRAINT pk_materia PRIMARY KEY (id_materia),
CONSTRAINT fk_materia_tecnicatura FOREIGN KEY (id_tecnicatura)
        	REFERENCES Tecnicaturas(id_tecnicatura))
 
CREATE TABLE Comisiones(
id_comision int,
descripcion_comision varchar(50)
CONSTRAINT pk_comision PRIMARY KEY (id_comision))
 
CREATE TABLE Titulos(
id_titulo int IDENTITY(1,1),
titulo varchar(40)
CONSTRAINT pk_titulo PRIMARY KEY (id_titulo))
 
CREATE TABLE Docentes(
id_docente int,
nom_docente varchar(30),
ape_docente varchar(30),
direccion varchar(50),
altura int,
nro_tel varchar(30),
email varchar(60),
id_titulo int,
id_barrio int
CONSTRAINT pk_docente PRIMARY KEY (id_docente),
CONSTRAINT fk_docente_titulo FOREIGN KEY (id_titulo)
        	REFERENCES Titulos(id_titulo),
CONSTRAINT fk_docente_barrio FOREIGN KEY (id_barrio)
        	REFERENCES Barrios(id_barrio))
 
CREATE TABLE Tipos_evaluacion(
id_tipo_evaluacion int IDENTITY(1,1),
tipo_evaluacion varchar(40)
CONSTRAINT pk_tipo_evaluacion PRIMARY KEY (id_tipo_evaluacion))
 
CREATE TABLE Detalle_materias_comisiones(
id_detalle_materia_comision int IDENTITY(1,1),
id_materia int,
id_docente int,
id_comision int,
año_lectivo int
CONSTRAINT pk_detalle_materia_comision PRIMARY KEY (id_detalle_materia_comision),
CONSTRAINT fk_detalle_materia_comision_materia FOREIGN KEY (id_materia)
        	REFERENCES Materias(id_materia),
CONSTRAINT fk_detalle_materia_comision_comision FOREIGN KEY (id_comision)
        	REFERENCES Comisiones(id_comision),
CONSTRAINT fk_detalle_materia_comision_docente FOREIGN KEY (id_docente)
        	REFERENCES Docentes(id_docente))
 
CREATE TABLE Detalles_alumnos_materias(
id_detalle_alumno_materia int,
id_alumno int,
id_detalle_materia_comision int,
id_estado_academico int,
fecha_inscripcion datetime,
fecha_estado datetime
CONSTRAINT pk_detalle_alumno_materia PRIMARY KEY (id_detalle_alumno_materia),
CONSTRAINT fk_detalle_alumno_materia_alumno FOREIGN KEY (id_alumno)
        	REFERENCES Alumnos(id_alumno),
CONSTRAINT fk_detalle_alumno_materia_estado_academico FOREIGN KEY (id_estado_academico)
 REFERENCES Estados_academicos(id_estado_academico),
CONSTRAINT fk_detalle_alumno_materia_detalle_mc FOREIGN KEY(id_detalle_materia_comision)
        	REFERENCES Detalle_materias_comisiones(id_detalle_materia_comision))
 
CREATE TABLE Evaluaciones(
id_evaluacion int,
fecha_evaluacion datetime,
nota int,
id_tipo_evaluacion int,
id_detalle_alumno_materia int
CONSTRAINT pk_evaluacion PRIMARY KEY (id_evaluacion),
CONSTRAINT fk_evaluacion_tipo_evaluacion FOREIGN KEY (id_tipo_evaluacion)
        	REFERENCES Tipos_evaluacion(id_tipo_evaluacion),
CONSTRAINT fk_evaluacion_detalle_alumno_materia FOREIGN KEY (id_detalle_alumno_materia)
REFERENCES Detalles_alumnos_materias(id_detalle_alumno_materia))
 
CREATE TABLE Examenes(
id_examen int,
fecha_examen datetime,
id_materia int,
id_docente int
CONSTRAINT pk_examenes PRIMARY KEY (id_examen),
CONSTRAINT fk_examenes_materias FOREIGN KEY (id_materia)
        	REFERENCES Materias(id_materia),
CONSTRAINT fk_examenes_docentes FOREIGN KEY(id_docente)
REFERENCES Docentes(id_docente))


CREATE TABLE Detalle_alumnos_examenes(
id_detalle_alumno_examen int identity(1,1),
id_alumno int,
id_examen int,
nota int
CONSTRAINT pk_detalle_alumno_examen PRIMARY KEY (id_detalle_alumno_examen)
CONSTRAINT fk_detalle_alumno_examen_alumno FOREIGN KEY (id_alumno)
        	REFERENCES Alumnos(id_alumno),
CONSTRAINT fk_detalle_alumno_examen_examen FOREIGN KEY (id_examen)
        	REFERENCES Examenes(id_examen));

