y la Carrera que esta cursando, esto para el año lectivo actual y que el codigo de
docente de la comision no sea 1,3,5,7 ni 9
Ademas unicamente traer la informacion de los alumnos que no hayan desaprobado
ningun examen el año pasado.
Ordenado por Tecnicatura y Alumno.*/
GO
CREATE PROC sp_sentencia1
AS
BEGIN
	SELECT DISTINCT nom_alumno+' '+ape_alumno 'Alumno',situacion_laboral,
		   (SELECT count(*) 
			  FROM Detalle_alumnos_examenes
			 WHERE id_alumno=a.id_alumno AND nota>5) 'Cantidad Examenes Aprobados', 
		   t.nom_tecnicatura 'Carrera'
	  FROM Alumnos a JOIN Situaciones_laborales s
		   ON s.id_situacion_laboral=a.id_situacion_laboral
		   JOIN Detalles_alumnos_materias dam ON dam.id_alumno=a.id_alumno
		   JOIN Detalle_materias_comisiones dmc ON
		   dam.id_detalle_materia_comision=dmc.id_detalle_materia_comision
		   JOIN Materias m ON m.id_materia=dam.id_detalle_materia_comision
		   JOIN Tecnicaturas t ON t.id_tecnicatura=m.id_tecnicatura
	 WHERE dmc.año_lectivo=year(getdate())
		   AND dmc.id_docente NOT IN (1,3,5,7,9)
		   AND a.id_alumno NOT IN (SELECT id_alumno
									 FROM Detalles_alumnos_materias d1 JOIN Evaluaciones e1
										  ON d1.id_detalle_alumno_materia=e1.id_detalle_alumno_materia
									WHERE e1.nota<6 AND year(e1.fecha_evaluacion)=year(getdate())-1)
	ORDER BY 4,1;
END;
--EXEC sp_sentencia1

/*2)
Por Alumno, traer la cantidad de examenes que rindio, el promedio de notas, la nota
mas alta que saco
ademas de la fecha del primer examen al que se presento unicamente para los
examenes de este año.
Que el apellido del alumno no termine en 'ez' y que el promedio de notas del alumno
sea mayor al promedio
de todas las notas de examenes rendidos el año pasado*/
GO
CREATE PROC sp_sentencia2
AS
BEGIN
	  SELECT nom_alumno+' '+ape_alumno 'Alumno', count(*) 'Cantidad examenes',
			 avg(nota) 'Promedio Nota', max(nota) 'Nota mas alta',
			 min(fecha_examen) 'Primer Examen'
		FROM Detalle_alumnos_examenes dae JOIN Alumnos a
			 ON dae.id_alumno=a.id_alumno
			 JOIN Examenes e ON dae.id_examen=e.id_examen
	   WHERE year(fecha_examen)=year(getdate())
			 AND a.ape_alumno NOT LIKE '%EZ'
	GROUP BY nom_alumno+' '+ape_alumno
	  HAVING avg(nota)>(SELECT avg(nota) 
						  FROM Detalle_alumnos_examenes d1 JOIN Examenes e1
							   ON d1.id_examen=e1.id_examen 
						 WHERE year(fecha_examen)=year(GETDATE()-1));
END;

--EXEC sp_sentencia2

/*3)
SE REQUIERE LISTAR los ID Y APELLIDOS DE LOS DOCENTES QUE NO
EMPIECEN CON LAS LETRAS [A-D] Y LA CANTIDAD DE ALUMNOS ‘POR
MATERIA’
SIEMPRE QUE LA CANTIDAD DE ALUMNOS POR MATERIA SEA MAYOR A 20.
ORDENAR POR APELLIDOS DE DOCENTES DE FORMA CRECIENTE Y POR
CANTIDAD DE ALUMNOS DE FORMA DECRECIENTE*/
GO
CREATE PROC sp_sentencia3
AS
BEGIN
	  SELECT dmc.id_materia, dmc.id_docente, ape_docente, count(dam.id_alumno) 'cantidad alumnos'
		FROM Alumnos a join Detalles_alumnos_materias dam on a.id_alumno =
			 dam.id_alumno
			 join Detalle_materias_comisiones dmc on dam.id_detalle_materia_comision =
			 dmc.id_detalle_materia_comision
			 join Docentes d on d.id_docente = dmc.id_docente join Materias m on
			 m.id_materia = dmc.id_materia
	   WHERE ape_docente not like '[a-d]%'
	GROUP BY dmc.id_materia,dmc.id_docente,ape_docente
	  HAVING count(a.id_alumno) > 20
	ORDER BY 3, 4 DESC
END;

--EXEC sp_sentencia3

/*4)
SE REQUIERE SABER EN BACA AL ESTADO CIVIL DE ESTUDIANTES:
PROMEDIOS DE NOTAS, CANTIDAD DE ALUMNOS.
MOSTRAR EL PROMEDIO GENERAL DE NOTAS EN EXÁMENES DE ESTE AÑO
PARA TENER COMO REFERENCIA.
SI SE DESCONOCE EL ESTADO CIVIL NO AGREGARLO A LA LISTA*/
GO
CREATE PROC sp_sentencia4
AS
BEGIN
	SELECT estado_civil, avg(nota) 'Prom de notas por EC', 
		   (SELECT avg(nota)
			  FROM Detalle_alumnos_examenes dae JOIN Examenes e on e.id_examen = dae.id_examen
			 WHERE year(fecha_examen) = year(getdate())
			 ) 'prom general de notas'
		FROM Evaluaciones e join Detalles_alumnos_materias dam on
			 e.id_detalle_alumno_materia = dam.id_detalle_alumno_materia
			 join Detalle_materias_comisiones dmc on dmc.id_detalle_materia_comision =
			 dam.id_detalle_materia_comision
			 join Alumnos a on a.id_alumno = dam.id_alumno
			 join Estados_civiles ec on ec.id_estado_civil = a.id_estado_civil
	   WHERE estado_civil is not null
	GROUP BY estado_civil
END;

--EXEC sp_sentencia4

/*5)Listar todos los datos de los alumnos que se inscribieron este año, están cursando
la Tecnicatura Universitaria en Programación y están promocionando alguna materia,
listar también, en la misma tabla, los docentes de la Tecnicatura Universitaria en
Programación que estén en este año lectivo.*/
GO
CREATE PROC sp_sentencia5
AS
BEGIN
	   SELECT a.id_alumno 'ID',
			  ape_alumno+', '+nom_alumno 'Nombre',
			  direccion+' - Nro: '+str(altura)+' - Barrio: '+b.barrio 'Direccion',
			  nro_tel 'Nro_Teléfono',
			  email 'Email',
			  'ALUMNO' 'Ocupacion'
		 FROM Alumnos a join Barrios b on a.id_barrio=b.id_barrio
		where a.id_alumno IN (SELECT id_alumno
								FROM Detalles_alumnos_materias
							   WHERE datediff(year, fecha_inscripcion,getdate()) = 0 )
			  and
			  a.id_alumno in (SELECT id_alumno
								FROM Detalles_alumnos_materias Dam join
									 Detalle_materias_comisiones Dmc
									 on Dam.id_detalle_materia_comision=Dmc.id_detalle_materia_comision
									 join Estados_academicos ea on
									 ea.id_estado_academico=Dam.id_estado_academico
							   WHERE ea.estado_academico LIKE '%prom%')
			  and 
			  exists (SELECT id_alumno
							FROM Detalles_alumnos_materias Dam join
								 Detalle_materias_comisiones Dmc
								 on Dam.id_detalle_materia_comision=Dmc.id_detalle_materia_comision
								 join Materias m on
								 Dmc.id_materia=m.id_materia
								 join Tecnicaturas t on
								 t.id_tecnicatura=m.id_materia
						   WHERE id_docente = a.id_alumno
								 and t.id_tecnicatura = 1)
	UNION
		SELECT id_docente,
			   ape_docente+', '+nom_docente,
			   direccion+' - Nro: '+str(altura)+' - Barrio: '+b.barrio,
			   nro_tel,
			   email,
			   'DOCENTE'
			FROM Docentes d join Barrios b on d.id_barrio=b.id_barrio
		   WHERE id_docente IN (SELECT distinct id_docente
								  FROM Detalle_materias_comisiones
								 WHERE año_lectivo = year(getdate()))
				 and 
				 EXISTS (SELECT id_docente
							   FROM Detalles_alumnos_materias Dam join
									Detalle_materias_comisiones Dmc
									on Dam.id_detalle_materia_comision=Dmc.id_detalle_materia_comision
									join Materias m on
									Dmc.id_materia=m.id_materia
									join Tecnicaturas t on
									t.id_tecnicatura=m.id_materia
							  WHERE id_docente = d.id_docente
									and t.id_tecnicatura = 1)
		order by 6 desc, 1
END;

--EXEC sp_sentencia5

/*6) Listar todos los datos de los alumnos, ademas agregar la Cantidad de Examenes
Aprobados,
la Cantidad de Examenes Desaprobados y su Nota Promedio.
Solo si se inscribieron este año, tienen menos de 5 parciales desaprobados (nota<6) y
su Nota Promedio es menor que la Nota Promedio General/Global.*/
GO
CREATE PROC sp_sentencia6
AS
BEGIN
  SELECT DISTINCT a.id_alumno 'ID',
		 ape_alumno+', '+nom_alumno 'Nombre',
		 direccion+' - Nro: '+str(altura)+' - Barrio: '+b.barrio 'Direccion',
		 nro_tel 'Nro_Teléfono',
		 email 'Email',
		 s.situacion_laboral 'Situacion_Laboral',
		 e.estado_civil 'Estado_Civil',
		 avg(nota) 'Nota_Promedio',
		 (SELECT count(*)
		 FROM Detalle_alumnos_examenes
		 WHERE id_alumno=a.id_alumno AND nota>5) 'Cant Examenes Aprobados',
	     (SELECT count(*)
		    FROM Detalle_alumnos_examenes
		   WHERE id_alumno=a.id_alumno AND nota<6) 'Cant ExamenesDesaprobados'
	FROM Alumnos a JOIN Situaciones_laborales s ON
		 s.id_situacion_laboral=a.id_situacion_laboral
		 JOIN Detalles_alumnos_materias Dam ON Dam.id_alumno=a.id_alumno
		 JOIN Detalle_materias_comisiones Dmc ON
		 Dam.id_detalle_materia_comision=Dmc.id_detalle_materia_comision
		 JOIN Detalle_alumnos_examenes Dae ON Dae.id_alumno=a.id_alumno
		 JOIN Materias m ON m.id_materia=dam.id_detalle_materia_comision
		 JOIN Tecnicaturas t ON t.id_tecnicatura=m.id_tecnicatura
		 JOIN Barrios b on a.id_barrio=b.id_barrio
		 JOIN Estados_civiles e on a.id_estado_civil=e.id_estado_civil
   WHERE 
		 5 > (SELECT count(*)
				FROM Detalle_alumnos_examenes
			   WHERE id_alumno=a.id_alumno AND nota<6)
	     and 
		 a.id_alumno IN (SELECT id_alumno
							   FROM Detalles_alumnos_materias
							  WHERE datediff(year, fecha_inscripcion, getdate()) = 0 )
GROUP BY a.id_alumno ,
		 ape_alumno+', '+nom_alumno,
		 direccion+' - Nro: '+str(altura)+' - Barrio: '+b.barrio,
		 nro_tel,
		 email,
		 s.situacion_laboral,
		 e.estado_civil
  HAVING avg(nota) < (SELECT avg(nota)
					    FROM Detalle_alumnos_examenes)
ORDER BY 1, 2
END;

--EXEC sp_sentencia6

/*7) Listar el promedio de nota de los exámenes y evaluaciones, y los datos de
aquellos alumnos que están inscritos en materias de más de una Tecnicatura y que
hayan aprobado al menos un examen en cada una de las Tecnicaturas en las que
están inscritos.*/
GO
CREATE PROC sp_sentencia7
AS
BEGIN
	  SELECT a.id_alumno 'Id Alumno',
			 a.ape_alumno + ' ' + a.nom_alumno 'Nombre Completo',
			 a.nro_tel 'Número de teléfono',
			 a.email 'E-mail',
			 CONCAT(a.altura, ', ', a.direccion, ', ', barrio, ', ', ciudad) 'Direción',
			 estado_civil 'Estado Civil',
			 situacion_laboral 'Situación Laboral',
			 (SELECT AVG(nota) 
			    FROM Detalle_alumnos_examenes 
			   WHERE id_alumno = a.id_alumno) 'Promedio Examenes',
			 (SELECT AVG(nota)
			    FROM Evaluaciones e JOIN Detalles_alumnos_materias dam ON
					 e.id_detalle_alumno_materia = dam.id_detalle_alumno_materia
			   WHERE id_alumno = a.id_alumno) 'Promedio Evaluaciones'
	    FROM Detalles_alumnos_materias dam JOIN Detalle_materias_comisiones dac ON
			 dam.id_detalle_materia_comision = dac.id_detalle_materia_comision
			 JOIN Materias m ON dac.id_materia = m.id_materia
			 JOIN Alumnos a ON dam.id_alumno = a.id_alumno
			 JOIN Estados_civiles e ON a.id_estado_civil = e.id_estado_civil
			 JOIN Situaciones_laborales s ON s.id_situacion_laboral = a.id_situacion_laboral
			 JOIN Barrios b ON a.id_barrio = b.id_barrio JOIN Ciudades c ON b.id_ciudad =
			 c.id_ciudad
	GROUP BY a.id_alumno,
			 a.ape_alumno,
			 a.nom_alumno,
			 a.nro_tel, a.email,
			 a.direccion,
			 a.altura,
			 barrio,
			 ciudad,
			 estado_civil,
			 situacion_laboral
	  HAVING COUNT(DISTINCT id_tecnicatura) > 1
			 AND COUNT(DISTINCT id_tecnicatura) = (SELECT COUNT(DISTINCT id_tecnicatura)
													 FROM Detalle_alumnos_examenes dae JOIN Examenes e 
													      ON dae.id_examen = e.id_examen
														  JOIN Materias m ON e.id_materia = m.id_materia
													WHERE id_alumno = a.id_alumno AND nota >= 6 AND id_tecnicatura = m.id_tecnicatura)
END;

--EXEC sp_sentencia7

/*8)
1ra Parte
Crear una vista con los datos de los docentes y el procentaje de aprobados/libres de
las materias en las que dio clases
*/
GO --Vista (VIEW) que usa la consulta Nro 8 (sp_sentencia8)
CREATE VIEW Porcentajes_Docentes AS
  SELECT d.id_docente,
		 d.nom_docente,
		 d.ape_docente,
		 d.id_titulo,
		 d.nro_tel,
		 d.email,
		 d.altura,
		 d.direccion,
		 d.id_barrio,
		 ((SELECT COUNT(*)
		     FROM Detalles_alumnos_materias dam JOIN
				  Detalle_materias_comisiones dac ON dam.id_detalle_materia_comision =
				  dac.id_detalle_materia_comision
			WHERE id_docente = d.id_docente AND id_estado_academico = 2) *
				  100 / COUNT(*)) porcentaje_alumnos_libres,
		 ((SELECT COUNT(*)
		     FROM Detalles_alumnos_materias dam JOIN
				  Detalle_materias_comisiones dac ON dam.id_detalle_materia_comision =
				  dac.id_detalle_materia_comision
			WHERE id_docente = d.id_docente AND id_estado_academico > 3) *
				  100 / COUNT (*)) porcentaje_alumnos_aprobados
    FROM Detalles_alumnos_materias dam JOIN Detalle_materias_comisiones dac ON
		 dam.id_detalle_materia_comision = dac.id_detalle_materia_comision
		 JOIN Docentes d ON d.id_docente = dac.id_docente
   WHERE id_estado_academico != 1
		 AND id_estado_academico != 3
GROUP BY d.id_docente,
		 d.nom_docente,
		 d.ape_docente,
		 d.id_titulo,
		 d.nro_tel,
		 d.email,
		 d.altura,
		 d.direccion,
		 d.id_barrio
  HAVING COUNT(*) > 0;

/*8) (el SP que usa la VIEW)
2da Parte
Usar la vista para obtener el promedio de nota de exámenes por ciudad de los
estudiantes de aquellos
docentes con aprobados por encima del promedio y por debajo del promedio, indicar a
que grupo pertenecen. Ordenar por tipo docente alfabéticamente y nota promedio
descendente.
*/
go
CREATE PROC sp_sentencia8
AS
BEGIN
	  SELECT AVG(nota) 'Nota promedio',
			 ciudad 'Ciudad',
			 'Docente con aprobados encima del promedio' 'Tipo Docente'
		FROM Ciudades c JOIN Barrios b ON c.id_ciudad = b.id_ciudad
			 JOIN Alumnos a ON a.id_barrio = b.id_barrio
			 JOIN Detalle_alumnos_examenes dae ON a.id_alumno = dae.id_alumno
			 JOIN Examenes e ON dae.id_examen = e.id_examen
			 JOIN Porcentajes_Docentes pd ON e.id_docente = pd.id_docente
	   WHERE pd.porcentaje_alumnos_aprobados > (SELECT AVG(porcentaje_alumnos_aprobados)
													FROM Porcentajes_Docentes)
	GROUP BY ciudad

  UNION

	  SELECT AVG(nota), ciudad, 'Docente con aprobados debajo del promedio'
		FROM Ciudades c JOIN Barrios b ON c.id_ciudad = b.id_ciudad
			 JOIN Alumnos a ON a.id_barrio = b.id_barrio
			 JOIN Detalle_alumnos_examenes dae ON a.id_alumno = dae.id_alumno
			 JOIN Examenes e ON dae.id_examen = e.id_examen
			 JOIN Porcentajes_Docentes pd ON e.id_docente = pd.id_docente
	   WHERE pd.porcentaje_alumnos_aprobados < (SELECT AVG(porcentaje_alumnos_aprobados)
														FROM Porcentajes_Docentes)
	GROUP BY ciudad
	ORDER BY 3, 1 DESC
END;

--exec sp_sentencia8

/*9)
Esta consulta muestra aquellas materias con los docentes a cargo, que tengan más de
15 alumnos con el estado
academico en regular, aprobado o promocionado*/
go	
CREATE PROC sp_sentencia9
AS
BEGIN
	  SELECT nom_materia Materia, descripcion_comision Comision, 
		     nom_tecnicatura Tecnicatura,
		     nom_docente+' '+ape_docente Docente
	    FROM Detalle_materias_comisiones dmc
			 JOIN Comisiones c ON c.id_comision=dmc.id_comision
			 JOIN Docentes d ON d.id_docente=dmc.id_docente
			 JOIN Materias m ON m.id_materia=dmc.id_materia
			 JOIN Tecnicaturas t ON t.id_tecnicatura=m.id_tecnicatura
	   WHERE id_detalle_materia_comision IN 
			   (SELECT id_detalle_materia_comision
				  FROM Detalles_alumnos_materias
			     WHERE id_estado_academico in (3,4,5)
					   AND YEAR(fecha_inscripcion)=2023
			  GROUP BY id_detalle_materia_comision
			    HAVING COUNT(*) >= 15 
			 )
	ORDER BY 3,2
END;

--EXEC sp_sentencia9

/*10)
Esta consulta muestra aquellos alumnos que:
*aprobaron todas las evaluaciones parciales con notas igual o mayor a 8(incluyendo
los trabajos prácticos).
*no hayan hecho un recuperatorio
*se hayan presentado a más de 3 exámenes finales durante el 2023. Y sus notas sean
igual o mayor a 6
*También se muestra la nota más alta y la más baja de los exámenes finales*/
GO
CREATE PROC sp_sentencia10
AS
BEGIN
	  SELECT a.nom_alumno Nombre, a.ape_alumno Apellido,
			 COUNT(id_detalle_alumno_examen) AS 'Cantidad de Examenes',
		     MAX(nota) 'Nota más alta', MIN(nota) 'Nota más baja'
	    FROM Alumnos a JOIN Detalle_alumnos_examenes dae 
		     ON a.id_alumno = dae.id_alumno
			 JOIN Examenes e ON dae.id_examen = e.id_examen
	   WHERE EXISTS 
			 (SELECT dam.id_alumno
			    FROM Detalles_alumnos_materias dam JOIN Evaluaciones ev 
				     ON dam.id_detalle_alumno_materia = ev.id_detalle_alumno_materia
			   WHERE dam.id_alumno=a.id_alumno
				     AND ev.nota >=8
				     AND ev.id_tipo_evaluacion<>3
			 )
			 AND year(fecha_examen)=2023
	GROUP BY a.id_alumno, a.nom_alumno, a.ape_alumno
	  HAVING COUNT(id_detalle_alumno_examen) >= 3
			 AND MIN(nota) >= 6
	ORDER BY COUNT(*) DESC;
END;

--EXEC sp_sentencia10

/*11)
Traer en una sola consulta, los datos de los alumnos de la TUP que se hayan inscripto
en tiempo y forma
(considerando que la fecha de inscripcion fue el 11/08/2023 para la ultima mesa de
inscripciones)
indicando inscripcion normal junto con la cantidad de materias que tienen
regulares,libres y promocionadas
Ademas traer esa informacion para alumnos que se inscribieron hasta una semana
despues de la fecha de inscripcion
Indicando Inscripcion tardia. Ordenar por condicion y alumno
*/
GO
CREATE PROC sp_sentencia11
AS
BEGIN
		 SELECT nom_alumno+' '+ape_alumno 'Alumno',descripcion_comision
				'Comision',t.nom_tecnicatura 'Carrerra',
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 2 AND id_alumno=A.id_alumno)'Cantidad Materias Libre',
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 3 AND id_alumno=A.id_alumno) 'Cantidad Materias
				Regulares',
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 5 AND id_alumno=A.id_alumno) 'Cantidad Materias
				Promocionadas','Inscripcion Normal' 'Tipo Inscripcion'
		   FROM Alumnos A JOIN Detalles_alumnos_materias Dam
				ON a.id_alumno=dam.id_alumno
				JOIN Detalle_materias_comisiones Dmc
				ON dmc.id_detalle_materia_comision=Dam.id_detalle_materia_comision
				JOIN Comisiones c
				ON dmc.id_comision=c.id_comision
				JOIN Materias M
				ON m.id_materia=dmc.id_materia
				JOIN Tecnicaturas t
				ON t.id_tecnicatura=M.id_tecnicatura
		  WHERE fecha_inscripcion='11/08/2023'
	UNION
		 SELECT nom_alumno+' '+ape_alumno,descripcion_comision,t1.nom_tecnicatura,
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 2 AND id_alumno=A1.id_alumno),
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 3 AND id_alumno=A1.id_alumno),
				(SELECT count(*) FROM Detalles_alumnos_materias WHERE
				id_estado_academico = 5 AND id_alumno=A1.id_alumno),'Inscripcion tardia'
		   FROM Alumnos A1 JOIN Detalles_alumnos_materias Dam1
				ON a1.id_alumno=Dam1.id_alumno
				JOIN Detalle_materias_comisiones Dmc1
				ON dmc1.id_detalle_materia_comision=Dam1.id_detalle_materia_comision
				JOIN Comisiones c1
				ON c1.id_comision=dmc1.id_comision
				JOIN Materias m1
				ON m1.id_materia=Dmc1.id_materia
				JOIN Tecnicaturas t1
				ON t1.id_tecnicatura=m1.id_tecnicatura
		  WHERE DATEDIFF(Day,'11/08/2023',fecha_inscripcion) Between 0 AND 7
	   ORDER BY 6,1;
END;

--EXEC sp_sentencia11

